import React, { useState, useEffect } from 'react';
import axios from 'axios';

const BookList = () => {
  const [books, setBooks] = useState([]);
  const [totalPages, setTotalPages] = useState(0);
  const [pageNumber, setPageNumber] = useState(0);
  const [pageSize] = useState(10); // You can adjust this if needed

  // Fetch books based on the page number
  useEffect(() => {
    const fetchBooks = async () => {
      try {
        const response = await axios.get(`http://localhost:8080/lms/books/grouped`, {
          params: {
            pageNumber: pageNumber,
            pageSize: pageSize
          }
        });

        setBooks(response.data.books);
        setTotalPages(response.data.totalPages);
      } catch (error) {
        console.error("Error fetching books:", error);
      }
    };

    fetchBooks();
  }, [pageNumber, pageSize]);

  // Handle page change
  const handlePageChange = (newPageNumber) => {
    setPageNumber(newPageNumber);
  };

  return (
    <div className="container mx-auto p-4">
      <h2 className="text-2xl font-semibold mb-4">Books List</h2>
      <table className="table-auto w-full border-collapse">
        <thead>
          <tr>
            <th className="px-4 py-2 border">Book Name</th>
            <th className="px-4 py-2 border">Author</th>
            <th className="px-4 py-2 border">ISBN</th>
            <th className="px-4 py-2 border">Edition</th>
            <th className="px-4 py-2 border">Category</th>
            <th className="px-4 py-2 border">Location</th>
            <th className="px-4 py-2 border">Available</th>
            <th className="px-4 py-2 border">Loaned</th>
            <th className="px-4 py-2 border">Total</th>
          </tr>
        </thead>
        <tbody>
          {books.map((book) => (
            <tr key={book.bookId}>
              <td className="px-4 py-2 border">{book.bookName}</td>
              <td className="px-4 py-2 border">{book.authorName}</td>
              <td className="px-4 py-2 border">{book.isbnNumber}</td>
              <td className="px-4 py-2 border">{book.edition}</td>
              <td className="px-4 py-2 border">{book.category}</td>
              <td className="px-4 py-2 border">{book.location}</td>
              <td className="px-4 py-2 border">{book.availableCount} (Yes)</td>
              <td className="px-4 py-2 border">{book.loanedCount} (No)</td>
              <td className="px-4 py-2 border">{book.totalCount}</td>
            </tr>
          ))}
        </tbody>
      </table>

      {/* Pagination */}
      <div className="flex justify-between items-center mt-4">
        <button
          onClick={() => handlePageChange(pageNumber - 1)}
          disabled={pageNumber <= 0}
          className="btn btn-primary"
        >
          Previous
        </button>

        <div>
          Page {pageNumber + 1} of {totalPages}
        </div>

        <button
          onClick={() => handlePageChange(pageNumber + 1)}
          disabled={pageNumber >= totalPages - 1}
          className="btn btn-primary"
        >
          Next
        </button>
      </div>
    </div>
  );
};

export default BookList;
